import { setUserDetails } from '../Actions';

const initialState = {
    userData: []
}
const UserDetails = (state = initialState, action) => {
    switch(action.type) {
        case 'user_details': 
            return {...state, data: setUserDetails.data};
        default:
            return state;
    }
}

export default UserDetails;
